from typing import List

class Solution:
    def minFallingPathSum(self, matrix: List[List[int]]) -> int:
        def solve(r, c):
            if r == N - 1:
                return matrix[r][c]
            if (r, c) in memo:
                return memo[(r, c)]
            res = float('inf')
            for dr, dc in directions:
                rnew = r + dr
                cnew = c + dc
                if 0 <= rnew < N and 0 <= cnew < N:
                    res = min(res, solve(rnew, cnew))
            memo[(r, c)] = matrix[r][c] + res
            return memo[(r, c)]
        
        N = len(matrix)
        directions = [[1,-1], [1,0], [1,1]]
        memo = dict()
        ans = float('inf')
        for c in range(N):
            ans = min(ans, solve(0, c))
        return ans

